𝗦𝘁𝗲𝗽𝘀 𝘁𝗼 𝗲𝗻𝘀𝘂𝗿𝗲 𝗪𝗵𝗲𝗮𝘁 𝗖𝗿𝗼𝗽 𝗦𝗮𝗳𝗲𝘁𝘆
Step 1: controlled climate, including cooling and aeration to reduce insect reproductive rate and humidity;
Step 2: controlled and airtight storage atmospheres;
Step 3: heat treatment (more than 60°C) to disinfest grain;
Step 4: physical barriers to protect uninfested grain;
Step 5: fumigation with penetrating gases;
Step 6: contact insecticides to control flying insects;
Step 7: admixing an insecticide or grain protectant;
Step 8: trapping to control rodents;
Step 9: resistant crop cultivars;
Step 10: statutory regulations affecting the quarantine or control of storage insects.
